import MessagesBox from './components/MessagesBox.jsx';

function App() {
  fetch("http://127.0.0.1:8000/acess/treinamento_final31.jsonl/0", {
      method: "GET",
      credentials: "include"
  })
  .then(response => {
      if (!response.ok) {
          throw new Error(`HTTP error! status: ${response.status}`);
      }
      return response.json();
  })
  .then(data => {
      messages = data.jsonline.messages.map(message => {
          return <MessagesBox text={message.content} role={message.role} />;
      })
  })
  .catch(error => {
    return <MessagesBox text={error}/>;

  });
}

export default App;
